import styled from "styled-components";

export const PerfilStyle = styled.div`

    background-image: linear-gradient(#D3D3D3, #808080);
    overflow: hidden;


    .container {
        margin: 0;
        width: 100vw;
        height: 100vh;
        overflow-x: hidden;
        display: flex;
        justify-content: space-between;
        background: blue;
    }

`
